import React from 'react'
import { useSelector,useDispatch } from 'react-redux';
import { Redirect } from 'react-router-dom';

function Asignatura() {
    const isLogged = useSelector((store) => store.authReducer.isLogged);
    return isLogged?(
        <div>
            hola
        </div>
    ):<Redirect to="/home"/>
}

export default Asignatura
